//Contract based on [https://docs.openzeppelin.com/contracts/3.x/erc721](https://docs.openzeppelin.com/contracts/3.x/erc721)
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";

contract DMSSign is ERC721URIStorage,Ownable{
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;

    mapping(address => uint256) private adminlist;
    mapping(address => uint256) private blacklist;

    mapping(address => mapping(uint256 => mapping(address => uint256))) private userSignedStatus;
    mapping(address => mapping(uint256 => mapping(address => uint256))) private userSignedTime;
    mapping(address => uint256 []) private userSignList;
    mapping(uint256 => uint256) private signListIdx;
    mapping(address => uint256 []) private userSignedList;
    mapping(uint256 => uint256) private signedListIdx;
    mapping(address => mapping(uint256 => mapping(address => uint256)))
        private _signerList;

    mapping(address => uint256[]) public nftListByAddress;
    mapping(uint256 => uint256) public TokenIndex;
    mapping(address => uint256) public userNumberNFT;
    mapping(address => mapping(uint256 => string)) public tokenURI;
    mapping(address => mapping(uint256 => address[])) public signerListOfDoc;
    mapping(address => mapping(uint256 => uint256)) public count;

    mapping(uint256 => uint256) public docIndex;
    uint256 [] docList;

    uint256 status = 0;

    constructor() public ERC721("Grooo", "Doc") {
        adminlist[msg.sender] = 1;
    }

    /* 
================================================================
                        LIST OF MODIFIERS
================================================================
 */
    modifier onlyAdmin() {
        require(adminlist[msg.sender] == 1, "OnlyAdmin");
        _;
    }

    modifier onlySigner(address nft, uint256 id) {
        require(_signerList[nft][id][msg.sender] == 1, "OnlySigner");
        _;
    }

    modifier isNotSigned(address nft, uint256 id) {
        require(userSignedStatus[nft][id][msg.sender] == 0, "IsNotSigned");
        _;
    }

    modifier isNotInBlackList(address account) {
        require(!checkBlackList(account), "Revert blacklist");
        _;
    }
    modifier eventGoingOn() {
        require(status == 1, "This feature has been stopped!");
        _;
    }
    modifier isNotAddressZero(address account) {
        require(account != address(0), "ERC20: transfer from the zero address");
        _;
    }

    function totalSupply() public view returns (uint256) {
        return _tokenIds.current();
    }

    /* 
================================================================
                        CHECK FUNCTION
================================================================
 */

    function checkAdmin(address account) public view returns (bool) {
        return adminlist[account] > 0;
    }

    function checkSigner(
        address nft,
        uint256 id,
        address account
    ) public view returns (bool) {
        return _signerList[nft][id][account] > 0;
    }

    function checkBlackList(address account) public view returns (bool) {
        return blacklist[account] > 0;
    }

    /* 
================================================================
                        MINT NFT
================================================================
 */
    function mintNFT(
        address recipient,
        string memory _tokenURI,
        address[] memory signerList
    ) public returns (uint256) {
        _tokenIds.increment();
        uint256 newItemId = _tokenIds.current();
        _mint(recipient, newItemId);
        _setTokenURI(newItemId, _tokenURI);
        uint256 arrayLength = nftListByAddress[recipient].length;
        TokenIndex[newItemId] = arrayLength;
        nftListByAddress[recipient].push(newItemId);
        userNumberNFT[recipient] += 1;
        tokenURI[address(this)][newItemId] =_tokenURI;
        signerListOfDoc[address(this)][newItemId] = signerList;

        uint256 offerLength = docList.length;
        docIndex[newItemId] = offerLength;
        docList.push(newItemId);
        
        for (uint256 i = 0; i < signerList.length; i++) {
            _signerList[address(this)][newItemId][signerList[i]] = 1;
            uint256 len = userSignList[signerList[i]].length; 
            signListIdx[newItemId] = len;
            userSignList[signerList[i]].push(newItemId);
        }

        emit NFTMinted(
            msg.sender,
            recipient,
            newItemId,
            userNumberNFT[recipient]
        );
        return newItemId;
    }

    function sign(address nft, uint256 tokenId)
        public
        onlySigner(nft, tokenId)
        isNotSigned(nft, tokenId)
    {
        count[nft][tokenId] ++;
        userSignedStatus[nft][tokenId][msg.sender] = 1; 
        userSignedTime[nft][tokenId][msg.sender] = block.timestamp;
        uint256 index = signListIdx[tokenId];
        uint256 len = userSignList[msg.sender].length; 
        if (len == 1) {
            userSignList[msg.sender].pop();
        } else {
            uint256 pop = userSignList[msg.sender][len - 1];
            userSignList[msg.sender][index] = pop;
            userSignList[msg.sender].pop();
            signListIdx[pop] = index;
        }

        uint256 length = userSignedList[msg.sender].length; 
        signedListIdx[tokenId] = length;
        userSignedList[msg.sender].push(tokenId);
    }

    /* 
================================================================
                        GET - SET FUNCTION
================================================================
*/
    function getUserCollectionList()
        public
        view
        returns (uint256[] memory)
    {
        address user = msg.sender;
        return nftListByAddress[user];
    }

    function getDocList() public view returns (uint256[] memory) {
        return docList;
    }

    function getUserNumberNFT(address user) public view returns (uint256) {
        return userNumberNFT[user];
    }

    function getUserSignList() public view returns (uint256[] memory) {
        address user = msg.sender;
        return userSignList[user];
    }

    function getUserSignedList() public view returns (uint256[] memory) {
        address user = msg.sender;
        return userSignedList[user];
    }

    function startEvent() public onlyAdmin {
        status = 1;
        emit EventStarted(msg.sender, status);
    }

    function stopEvent() public onlyAdmin {
        status = 0;
        emit EventStopped(msg.sender, status);
    }

    /* 
================================================================
                        TRANSFER
================================================================
*/
    function checkTokenIndex(uint256 tokenId) public view returns (uint256) {
        return TokenIndex[tokenId];
    }

    function _transfer(
        address from,
        address to,
        uint256 tokenId
    ) internal virtual override {
        require(1 == 0, "Can not transfer!");
    }


    /* 
================================================================
                        ADMIN LIST
================================================================
 */
    function addToAdminlist(address account) public onlyOwner {
        adminlist[account] = 1;
        emit AdminAdded(account);
    }

    function addBatchToAdminlist(address[] memory accounts) public onlyOwner {
        for (uint256 i = 0; i < accounts.length; i++) {
            adminlist[accounts[i]] = 1;
        }
        emit BatchAdminAdded(accounts);
    }

    function removeFromAdminlist(address account) public onlyOwner {
        adminlist[account] = 0;
        emit AdminRemoved(account);
    }

    /* 
================================================================
                        BLACK LIST
================================================================
 */

    function addToBlacklist(address account) public onlyOwner {
        blacklist[account] = 1;
        emit BlacklistAdded(account);
    }

    function addBatchToBlacklist(address[] memory accounts) public onlyOwner {
        for (uint256 i = 0; i < accounts.length; i++) {
            blacklist[accounts[i]] = 1;
        }
        emit BatchBlacklistAdded(accounts);
    }

    function removeFromBlacklist(address account) public onlyOwner {
        blacklist[account] = 0;
        emit BlacklistRemoved(account);
    }

    /* 
================================================================
                        SIGNER LIST
================================================================
 */
    function addToSignerlist(
        address nft,
        uint256 id,
        address account
    ) public onlyOwner {
        _signerList[nft][id][account] = 1;
        emit SignerAdded(account);
    }

    function addBatchToSignerlist(
        address nft,
        uint256 id,
        address[] memory accounts
    ) public onlyOwner {
        for (uint256 i = 0; i < accounts.length; i++) {
            _signerList[nft][id][accounts[i]] = 1;
        }
        emit BatchSignerAdded(accounts);
    }

    function removeFromSignerlist(
        address nft,
        uint256 id,
        address account
    ) public onlyOwner {
        _signerList[nft][id][account] = 0;
        emit SignerRemoved(account);
    }

    /* 
================================================================
                            EVENT
================================================================
 */
    event BlacklistAdded(address account);
    event BatchBlacklistAdded(address[] accounts);
    event BlacklistRemoved(address account);

    event AdminAdded(address account);
    event BatchAdminAdded(address[] accounts);
    event AdminRemoved(address account);

    event SignerAdded(address account);
    event BatchSignerAdded(address[] accounts);
    event SignerRemoved(address account);

    event OwnerNFTChanged(address from, address to, uint256 tokenID);
    event EventStarted(address user, uint256 status);
    event EventStopped(address user, uint256 status);
    event WithDraw(uint256 amount);

    event NFTMinted(
        address user,
        address wallet,
        uint256 tokenID,
        uint256 numNFTtri
    );

    function getDocInfo (uint256 tokenId) public view returns (string memory, address[] memory) {
        string memory uri = tokenURI[address(this)][tokenId];
        address[] memory list = signerListOfDoc[address(this)][tokenId];
        return (uri, list);
    }

    function checkUserSignedStatus (uint256 tokenId, address user) public view returns (uint256) {
        return userSignedStatus[address(this)][tokenId][user];
    }

    function checkUserSignedTime (uint256 tokenId, address user) public view returns (uint256) {
        return userSignedTime[address(this)][tokenId][user];
    }

    function checkPublicStatus (uint256 tokenId) public view  returns (uint256) {
        uint256 max_count = signerListOfDoc[address(this)][tokenId].length;
        if (count[address(this)][tokenId] == max_count){
            return 1;
        } else {
            return 0;
        }
    }

    function getCurrentId () external view returns (uint256){
        uint256 tokenIDNow = _tokenIds.current();
        return tokenIDNow;
    }
}
